Нарушение технологии установки бортового камня: 
- Отсутствует песчаное/щебеночное основание;
- Устройство бетонного замка без установки опалубки;
- Установка бортового камня на неровное основания из бетона, наличие многочисленных пустот между бортовым камнем и основанием;
- Отсутствие/разрушение бетонного замка.
